import './teamcard.css'

function TeamCards(props) {
  return (
    <>
        <div className="card p-0 m-0 h-100 text-center">
        <img  className="teamimg img-fluid" src={props.Data.Image} alt="" />
        <h1  className="teamheading text-success m-0 p-0">{props.Data.Id}</h1>
        <h2  className="teamheading text-success m-0 p-0">{props.Data.Name}</h2>
        <h3  className="teamtitle text-info m-0 p-0">{props.Data.Title}</h3>
        <p  className="teamdesc  text-secondary m-0 p-0">{props.Data.Description}</p>
      </div>
    </>
  );
}

export default TeamCards;
